@Test
  public void when_EventsAreCompared_then_TheyAreOrderdByTimestamp() {
    assertEquals(-1, e1.compareTo(e2));
    assertEquals(0, e1.compareTo(e1));
    assertEquals(1, e2.compareTo(e1));
  }

